const { name, email, id } = (props) =>{
	return (
		<div className="bg-light-green dib tc br3 pa3 ma2 grow bw-2 shadow-5">
			<img alt='robots' src={`https://robohash.org/${props.id}?set.=set2`} />
			<div>
				<h2>{ props.name }</h2>
				<p>{ props.email }</p>
			</div>
		</div>
	);
}
export default Card;
